import React from "react";
import NavBar from "../navbar/NavBar";


function Blog(){
    return(
        <div>
            <NavBar/>
            <div>
                <div><img src="/Images/map.png" alt=""/></div>
                <div>
                    <h1>Cours Ph</h1>
                </div>
            </div>
        </div>
    )
}
export default Blog
